import './Prodotti.css';

const Prodotti = () => {
<div id='container'>
<Flexbox flexDirection="row" minHeight="100vh">
  <Flexbox flexGrow={3}>
    Content
  </Flexbox>
</Flexbox>
</div>
};

export default Prodotti
